import React, { Component } from 'react';
import {Grid, Jumbotron} from 'react-bootstrap';


class App extends Component {
  render() {
    return (
      <div>
        <Jumbotron>
          <grid>
          <h1>Search App</h1>
          <p>This is a simple search app.</p>
          </grid>
        </Jumbotron>
      </div>
    );
  }
}

export default App;
